import React, { Component } from 'react';
import LogoPC from './images/LogoPC.svg';
import { Link } from 'react-router-dom';
import { Layout, Navigation, Content } from 'react-mdl';
import Posti from './images/Posti.jpg';
import HackathonGOC from './images/HackathonGOC.jpg';
import CodeWeek from './images/CodeWeek.jpg';
import Adidas from './images/Adidas.jpg';
import BetsFriends from './images/BetsFriends.jpg';
import Vredestein from './images/Vredestein.jpg';
import PCdesign from './images/PC-Design.jpg';
import PCtechnical from './images/PC-Technical.jpg';

import "fullpage.js/vendors/scrolloverflow"; // Optional. When using scrollOverflow:true
import ReactFullpage from "@fullpage/react-fullpage";

class Landing extends Component {
  render() {
    return(
      <ReactFullpage
        fitToSection = {true}
        sectionsColor = {["white", "purple", "green"]}
        scrollOverflow = {true}
        render={({ state, fullpageApi }) => {
          return (
            <div id="fullpage-wrapper">
              <div className="section">
                <div>
                <img src={LogoPC} style={{height: '20em'}}/>
                <h1>UX / UI Designer</h1>
                <p>"Design it till you make it"</p>
                <Link to="/PC-folio.github.io/projects"
                  style= {{fontWeight: 'bold', fontSize: '1.5em', color: 'black'}}>
                  projects</Link>
                </div>
              </div>
              <div className="section">
                  <div className="slide">
                    <h3>Slide 2.1</h3>
                    <button onClick={() => fullpageApi.moveTo(3, 0)}>
                      Move top
                    </button>
                  </div>
                  <div className="slide">
                    <h3>Slide 2.2</h3>
                  </div>
                  <div className="slide">
                    <h3>Slide 2.3</h3>
                  </div>
                </div>
              <div className="section">
                <h3>Section 3</h3>
                <button onClick={() => fullpageApi.moveTo(2, 0)}>
                  Move top
                </button>
              </div>
            </div>
          );
        }}
      />
    );
  }
}

export default Landing;
